import React from 'react';
import '../css/Banner.css';

const Banner = () => {
  return (
    <>
    <div className="container_">
    <p className="head">Welcome</p>
    <p className="head head1">Pablo Nicolus</p>
    <p className='head2'></p>
    </div>
    </>
  );
};

export default Banner;
